INSERT INTO `wy_bse_project` (`id`, `company_id`, `proj_type`, `proj_name`, `proj_logo`, `proj_province_id`, `proj_province`, `proj_city_id`, `proj_city`, `proj_district_id`, `proj_district`, `proj_addr`, `proj_occupy`, `proj_buildarea`, `proj_usablearea`, `proj_far`, `proj_pic`, `water_price`, `electric_price`, `bill_instruction`, `operate_entity`, `is_valid`, `support`, `advantage`, `c_uid`, `u_uid`, `created_at`, `updated_at`, `deleted_at`) VALUES (8, 8, '创意园区', '郎园Vintage', '', 2, '北京市', 36, '北京城区', 39, '朝阳区', '郎家园6号', 30000, 34717, 30000, '0.5', '8/business/20211020/ZFZ2SMV0ijroFqSecNcNhMSI7BjKztUMLZ7mpZWf.png', 0.0000, 0.0000, NULL, NULL, 1, '国贸唯一低密度 市级示范园区\n\n【项目位置】郎家园6号院\n【项目配套】公共书房，活动空间，咖啡厅，中、西、日各式餐厅，员工食堂，酒吧，丰富文化活动\n【交通路网】临1、10、14号三线地铁，多条公交', '【优势1】CBD 核心区位，低密度\n【优势2】24小时空调（无加时费）\n【优势3】充足车位', 19, 25, '2021-08-16 14:34:34', '2021-12-16 16:21:55', NULL);
INSERT INTO `wy_bse_project` (`id`, `company_id`, `proj_type`, `proj_name`, `proj_logo`, `proj_province_id`, `proj_province`, `proj_city_id`, `proj_city`, `proj_district_id`, `proj_district`, `proj_addr`, `proj_occupy`, `proj_buildarea`, `proj_usablearea`, `proj_far`, `proj_pic`, `water_price`, `electric_price`, `bill_instruction`, `operate_entity`, `is_valid`, `support`, `advantage`, `c_uid`, `u_uid`, `created_at`, `updated_at`, `deleted_at`) VALUES (9, 8, '创意园区', '郎园park', '', 2, '北京市', 36, '北京城区', 41, '石景山区', '石景山', 20000, 30000, 20000, '0.5', '8/business/20211126/4OEnqADgcaAbY14Bl3Ez37uLInLghO1MNOOnHFUJ.jpg', 0.0000, 0.0000, NULL, NULL, 1, '郎园park是由石景山区政府与首创集团联合打造的文化创意产业园区。\n项目位于长安街与上庄大街交汇处东北角。\n【项目介绍】3.5万㎡ 郎园Park，是在郎园Vintage10年运营积累和运营理念之上，把“绿色、生态、创意”的空间改造理念和“文化大院、鱼塘生态、城市大学”的运营理念带进石景山，并结合石景山区和项目区块特质，打造城市公共文化项目。\n【配 套】餐饮街、咖啡厅、书店、儿童教培、生活美学手作店......\n【交 通】地铁1号线八宝山站B口向北150米', '优势1.公共交通便利，地铁上盖。\n优势2.绿化率高：外围2公里范围内有老山城市休闲公园、冰雪主题公园、北京国际雕塑公园，晋元滨水公园。\n优势3：无边界生态设计：项目主体置身于西长安街文化艺术公园，对周边城市绿带统筹规划，将项目植入一个连续的、下沉的、景观丰富的绿色生态公园中。', 19, 25, '2021-08-16 16:19:56', '2021-11-26 15:17:15', NULL);
