INSERT INTO `wy_bse_project` (`id`, `company_id`, `proj_type`, `proj_name`, `proj_logo`, `proj_province_id`, `proj_province`, `proj_city_id`, `proj_city`, `proj_district_id`, `proj_district`, `proj_addr`, `proj_occupy`, `proj_buildarea`, `proj_usablearea`, `proj_far`, `proj_pic`, `water_price`, `electric_price`, `bill_instruction`, `operate_entity`, `is_valid`, `support`, `advantage`, `c_uid`, `u_uid`, `created_at`, `updated_at`, `deleted_at`) VALUES (12, 8, '创意园区', '郎园station', '', 2, '北京市', 36, '北京城区', 39, '朝阳区', '东坝乡', 0, 120000, 0, '2.0', '', 0.0000, 0.0000, NULL, NULL, 1, '首创•郎园Station，位于朝阳区东坝乡\n【园区配套】3200亩将府公园、魔尔公寓（酒店）、通勤班车、员工餐厅、健身中心、咖啡厅、VIP餐厅、私人会客厅、会议室、腾讯视频馆、2000㎡仓酷秀场、5000㎡图书空间\n【交通】地铁14号线将台站、东风北桥站东四环路、东五环路、坝河观光游船（郎园码头站）', '首创•郎园Station通过“坝河国际美食港”、“中央车站文化广场”、“中轴创意展示商街”、“公园森林休闲步行西街”，打造坝河夜游、深夜食堂美食街、深夜文化广场秀、深夜森林＋工业风市集等大型户外文化消费项目，辅以“体育动力中心”、“公益城市书房”、“复合式森林图书馆”、“综合文化剧场”、“设计师酒店”、“设计师聚落”等改造设计，引进夜跑、深夜城市书房、夜间读书沙龙、音乐剧、话剧、脱口秀、开放麦、驻场秀等文化娱乐内容，围绕建设“国际范儿”“北京味”“时尚潮”夜间生活聚集区的目标，以不间断的文化盛宴，将会把郎园Station打造成夜间滨水国际文化消费的生态型新商圈。改造完成的郎园Station将秉承“无边界，与区域共生进化”的理念，全园区24小时开放式运营。', 25, 25, '2021-10-15 10:46:20', '2021-10-21 10:37:15', NULL);
INSERT INTO `wy_bse_project` (`id`, `company_id`, `proj_type`, `proj_name`, `proj_logo`, `proj_province_id`, `proj_province`, `proj_city_id`, `proj_city`, `proj_district_id`, `proj_district`, `proj_addr`, `proj_occupy`, `proj_buildarea`, `proj_usablearea`, `proj_far`, `proj_pic`, `water_price`, `electric_price`, `bill_instruction`, `operate_entity`, `is_valid`, `support`, `advantage`, `c_uid`, `u_uid`, `created_at`, `updated_at`, `deleted_at`) VALUES (13, 8, '创意园区', '咏园', '', 2, '北京市', 36, '北京城区', 38, '西城区', '永生巷4号', 0, 11824, 0, '1.2', '8/business/20211022/Qlkp310DYDZTWroSqhoobBq8WJVRwrbOyF31GURf.jpg', 0.0000, 0.0000, NULL, NULL, 1, '【项目介绍】\n1.园区总建筑面积1.4万平方米，共设置有朝雨楼、琼华楼、采薇楼、棠颂楼、鹿鸣苑、章天楼、九如楼、穆清楼等八个区域\n2.咏园的改造建设有效地促进了存量空间资源盘活利用和产业转型升级，加快创意设计与非遗传统文化融合发展，打造成为传统文化与现代文明交相辉映，历史文脉与时尚创意相得益彰的新典范。', '【项目优势1】承载非遗创作、研发、设计、试制、展示、销售、体验、培训等丰富业态，全面推动非遗创造性转化，创新性发展，实现非遗活态传承.\n【项目优势2】园区依托首创非遗平台资源提供全方位服务，向园区入驻及合作的传承人、匠人、设计师、非遗企业及设计等文创企业赋能，为全国的优秀非遗创新转化成果的商品化提供平台支持，为优秀的非遗创新设计和IP成果转化提供资源对接、授权服务、投资支持、商业孵化等全方位的产业链服务。2020年咏园被评为市级文化产业园区。', 25, 25, '2021-10-15 10:48:39', '2022-01-06 10:34:43', NULL);
INSERT INTO `wy_bse_project` (`id`, `company_id`, `proj_type`, `proj_name`, `proj_logo`, `proj_province_id`, `proj_province`, `proj_city_id`, `proj_city`, `proj_district_id`, `proj_district`, `proj_addr`, `proj_occupy`, `proj_buildarea`, `proj_usablearea`, `proj_far`, `proj_pic`, `water_price`, `electric_price`, `bill_instruction`, `operate_entity`, `is_valid`, `support`, `advantage`, `c_uid`, `u_uid`, `created_at`, `updated_at`, `deleted_at`) VALUES (14, 8, '创意园区', '中传项目', '', 2, '北京市', 36, '北京城区', 39, '朝阳区', '北京市朝阳区花园闸路1号', 0, 20105, 0, '', '', 0.0000, 0.0000, NULL, NULL, 1, '地址：北京市朝阳区花园闸路1号\n地铁：八通线高碑店站B出口向北步行10分钟\n公交：附近10分钟步行范围内分布大黄庄桥西站、朝阳路高井站、高碑店桥东站等。\n车位：位于地下一、二层，共计99个；月租500元/月', '首创中传是中国传媒大学与首创集团联合共建的传媒产业创新服务中心，打造集创业孵育、校友社群、人才实训、产业链对接、产学研合作等多服务产业共创基地，针对传媒科创、数字文创产业提供从空间到业务的一站式服务，促进数字文化产业新模式应用与转化。\n\n运营理念：以空间为载体 服务为手段—搭建文化科技创意平台 焕新文创未来', 25, 25, '2022-01-04 13:04:19', '2022-01-04 14:13:52', NULL);
INSERT INTO `wy_bse_project` (`id`, `company_id`, `proj_type`, `proj_name`, `proj_logo`, `proj_province_id`, `proj_province`, `proj_city_id`, `proj_city`, `proj_district_id`, `proj_district`, `proj_addr`, `proj_occupy`, `proj_buildarea`, `proj_usablearea`, `proj_far`, `proj_pic`, `water_price`, `electric_price`, `bill_instruction`, `operate_entity`, `is_valid`, `support`, `advantage`, `c_uid`, `u_uid`, `created_at`, `updated_at`, `deleted_at`) VALUES (15, 8, '创意园区', '白马湖', '', 12, '浙江省', 945, '杭州市', 961, '滨江区', '白马湖', 0, 25668, 0, '2.0', '', 0.0000, 0.0000, NULL, NULL, 1, '1.周边人群：周围成熟生活社区林立，分布多个大中型社区及高端别墅区。\n2.产业优势：每年国际动漫节、文博会、湘湖旅游区、湘湖宋城旅游区吸引大量游客。\n3.商业配套：星光大道步行街、龙湖天街、宝龙城、中南乐游城购物中心。\n4.金融配套：四大国有、中心、杭州、浙商等银行网点。\n5.机动车停车位：933辆', '文创动漫--生活场景，打造中国动漫第一基地\n培育动漫产业全链条聚集的生态圈\n\n1.空间运营：场景化、沉浸式、互动式的多 体验运营理念； 2.业态组成：集办公、教育、会展、动漫体 验、动漫商\n科技研发、产业孵化、文 化传媒等于一体的国际化水准动漫产业示范区。', 25, 25, '2022-01-04 13:05:43', '2022-01-04 13:42:18', NULL);
